import { useContext, useState } from 'react';
import { UserContext } from '../../pages/Home/AdminBoard';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Card from 'react-bootstrap/Card';
import Stack from 'react-bootstrap/Stack';
import { useSwipeable } from 'react-swipeable'; // Importing useSwipeable hook for swipe gestures

import "../../styles/NotebookView.css"
import axios from 'axios';

function UserViewModal(props) {
  const { viewUser, notebook, setNotebooks } = useContext(UserContext);
  const [swipingState, setSwipingState] = useState({}); // To hold the swipe state for each notebook

  // Async function to handle notebook deletion
  const handleDeleteNotebook = async (nb) => {
    try {
      const response = await axios.post("http://localhost:8080/notebooks/delete", nb);
      setNotebooks(response.data); // Update notebooks after deletion
    } catch (error) {
      console.error("Error deleting notebook:", error);
    }
  };

  // Handling swipe gestures and invoking the delete function on swipe left
  const handleSwipe = (nbId, direction) => {
    setSwipingState(prevState => ({
      ...prevState,
      [nbId]: { ...prevState[nbId], swiping: true, swipeDirection: direction }
    }));

    // If swipe is left, delete the notebook
    if (direction === 1) {
      const notebookToDelete = notebook.find(n => n.id === nbId);
      if (notebookToDelete) {
        handleDeleteNotebook(notebookToDelete);
      }
    }
  };

  // Use swipeable hooks for each card in a more consistent way
  const swipeableCards = notebook.map((nb) => {
    const swipeHandlers = useSwipeable({
      onSwipedLeft: () => handleSwipe(nb.id, 1),  // Swipe left to delete
      onSwipedRight: () => handleSwipe(nb.id, -1), // Swipe right for another action (if needed)
      preventDefaultTouchmoveEvent: true,
      trackMouse: true,
    });

    return (
      <div
        key={nb.id}
        {...swipeHandlers}  // Apply swipe handlers individually for each notebook
        className="notebook-entry"
        data-notebook={JSON.stringify(nb)} // Store notebook data in a data attribute
        style={{
          transform: `translateX(${swipingState[nb.id]?.swipeDirection * 100}%)`, // Move each notebook individually
          transition: swipingState[nb.id]?.swiping ? 'transform 0.3s ease' : 'none', // Smooth transition
        }}
      >
        <Card className="notebook-entry shadow-sm">
          <Card.Body>
            <Card.Title className="text-primary">Notebook #{nb.id}</Card.Title>
            <Card.Text><strong>Title:</strong> {nb.notebookName}</Card.Text>
            <Card.Text><strong>Notes:</strong> {nb.notes}</Card.Text>
            <Card.Text><strong>Resolution:</strong> {nb.resolution}</Card.Text>
          </Card.Body>
        </Card>
      </div>
    );
  });

  if (!viewUser) {
    return null;
  }

  return (
    <Modal
      {...props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
        <Modal.Title id="contained-modal-title-vcenter">
          User Info
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <h5 className="mb-4">User's Notebooks</h5>
        {notebook.length > 0 ? (
          <Stack gap={3}>
            {swipeableCards}  {/* Render all the cards here */}
          </Stack>
        ) : (
          <p className="text-muted">No notebooks available for this user.</p>
        )}
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={props.onHide}>Close</Button>
      </Modal.Footer>
    </Modal>
  );
}

export default UserViewModal;
